import "./MainScreen.css";

function MainScreen(props){
    const title = props.title;
    const child = props.child;

    return(


            <Container >
                <Row>
                    <div className = "page">

                        <h1 className = "heading">{title}</h1>
                        <hr/>
                        <div>
                    {child}
                    </div>
                    </div>
                </Row>
            </Container>


    );


}

export default MainScreen
